import { init, AuthType } from '@thoughtspot/visual-embed-sdk';
import { SearchEmbed, LiveboardEmbed } from '@thoughtspot/visual-embed-sdk/react';
import logo from './logo.png';
import truck from './grocery.png';

// If you are using Webpack 4 (which is the default when using create-react-app v4), you would need to import
// the React components using the below:
//import { SearchEmbed, AuthType  } from '@thoughtspot/visual-embed-sdk/lib/src/react';

init({
    thoughtSpotHost: 'https://try.thoughtspot.cloud/#/',
    authType: AuthType.None,
});

const Thoughtspot = ({ dataSources }) => {
    const [search, setSearch] = useState('')
    const onCustomAction = (actionEvent) => {
        // Do something with actionEvent.
    };
    let liveboardId = '769600df-adff-4945-9b55-07823f10ac99'

    let thoughtspotComponent;
    if (search) {
      thoughtspotComponent = <SearchEmbed frameParams={params} dataSources={dataSources} onCustomAction={onCustomAction} />;
    } else {
      thoughtspotComponent = <LiveboardEmbed frameParams={params} liveboardId={liveboardId} onCustomAction={onCustomAction} />;
    }
    function viewDash(){
        setSearch(false);
    }
    function viewSearch(){
        setSearch(true);
    }
    console.log(dataSources);
    let params = {'width':'1400px','height': '800px'};
    return (<div style={{'display':'flex','height':'1000px', 'width':'100%','min-width':'900px', 'flex-direction':'row'}}>
            <div style={{'display':'flex','flex-direction':'column','height':'100%','width':'150px', 'background':'#d699c2'}}>
                <img style={{'margin':'30px'}} src={logo} />
                <div class="navOptionThoughtspot">Inventory</div>
                <div class="navOptionThoughtspot">Sales</div>
                <div class="navOptionThoughtspot selected">Insights</div>
                <div class="navOptionThoughtspot">Settings</div>
                <div class="navOptionThoughtspot">Logout</div>
            </div>
            <div style={{'display':'flex','flex':'1','width':'100%'}}>
                <div style={{'display':'flex','flex-direction':'column','width':'100%','padding-left':'20px'}}>
                    <div style={{'display':'flex','height':'200px','align-items': 'center','justify-content': 'right','margin-right':'150px','padding-top':'55px'}} ><img height='270px' width='400px' src={truck} /></div>
                    <div></div>
                    <div style={{'display':'flex','height':'100px','margin-top':'-50px'}} >
                        {thoughtspotComponent}
                    </div>
                </div>
            </div>
            </div>
    )
}
export default Thoughtspot;
